# 시작과 도착이 이어져 있는지 확인하는 함수
def find_ans_cnt(x, y, miro, n):
    global anscnt, visited
    anscnt = 0
    visited = [[0 for _ in range(n + 2)] for _ in range(n + 2)]
    visited[x][y] = 1  # 시작 지점을 방문한 것으로 마크
    
    def dfs(x, y, miro, n):
        global anscnt, visited
        dx = [-1, 1, 0, 0]
        dy = [0, 0, -1, 1]
        if x == y == n:
            anscnt += 1
        
        for i in range(4):
            nx = x + dx[i]
            ny = y + dy[i]
            if 1 <= nx <= n and 1 <= ny <= n and visited[nx][ny] == 0 and miro[nx][ny] != 1:
                visited[nx][ny] = 1  # 이동한 부분 마크
                dfs(nx, ny, miro, n)
                visited[nx][ny] = 0
        return
    
    dfs(x, y, miro, n)
    return anscnt


